import React, {useState} from 'react';

const Display = (props) => {

    let moviesDisplay = props.movieData.results.map((movies, index) => {
        {movies.original_title}
    })

    return (
        <div>
            {moviesDisplay}
        </div>
    )
}

export default Display;
